import React from 'react';
import PropTypes from 'prop-types';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';




function createData(name, calories, fat, carbs, protein) {
  return { name, calories, fat, carbs, protein };
}

const rows = [
  createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
  createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
  createData('Eclair', 262, 16.0, 24, 6.0),
  createData('Cupcake', 305, 3.7, 67, 4.3),
  createData('Gingerbread', 356, 16.0, 49, 3.9),
];

function TabPanel(props) {
	const { children, value, index, ...other } = props;

	return (
		<div
			role="tabpanel"
			hidden={value !== index}
			id={`scrollable-auto-tabpanel-${index}`}
			aria-labelledby={`scrollable-auto-tab-${index}`}
			{...other}
		>
			{value === index && (
				<Table size="small" aria-label="a dense table">
					<TableHead>
						<TableRow>
							<TableCell>Pair</TableCell>
							<TableCell align="right">Parent Market</TableCell>
							<TableCell align="right">Category of PM</TableCell>
							<TableCell align="right">Open Price</TableCell>
							<TableCell align="right">Change % </TableCell>
						</TableRow>
					</TableHead>
					<TableBody>
					{children.map((row) => (
						<TableRow key={row.name}>
							<TableCell component="th" scope="row">
								{row.name}
							</TableCell>
							<TableCell align="right">{row.calories}</TableCell>
							<TableCell align="right">{row.fat}</TableCell>
							<TableCell align="right">{row.carbs}</TableCell>
							<TableCell align="right">{row.protein}</TableCell>
						</TableRow>
					))}
					</TableBody>
				</Table>		
			)}
		</div>
	);
}

TabPanel.propTypes = {
	children: PropTypes.node,
	index: PropTypes.any.isRequired,
	value: PropTypes.any.isRequired,
};

function a11yProps(index) {
	return {
		id: `scrollable-auto-tab-${index}`,
		'aria-controls': `scrollable-auto-tabpanel-${index}`,
	};
}

const useStyles = makeStyles((theme) => ({
	root: {
		flexGrow: 1,
		width: '100%',
		backgroundColor: theme.palette.background.paper,
	},
}));

function setupTabMenue(props) {
	let index = 0
	const tab_menu = Object.keys(props.tab_base).map((key) => {
		return (
			<Tab label={key} {...a11yProps(() => index=index+1)} />
		)	
	})


	return <Tabs
			value={value}
			onChange={handleChange}
			indicatorColor="primary"
			textColor="primary"
			variant="scrollable"
			scrollButtons="auto"
			aria-label="scrollable auto tabs example"
		   >
		   	{tab_menu}
		   </Tabs>	
}

export default function ScrollableTabsButtonAuto(props) {
	const classes = useStyles();
	const [value, setValue] = React.useState(0);

	const handleChange = (event, newValue) => {
		setValue(newValue);
	};

	return (
		<div className={classes.root}>
			<AppBar position="static" color="default">
				{ setupTabMenue(props) }
			</AppBar>
			<TabPanel value={value} index={0}>
				{rows}
			</TabPanel>
			<TabPanel value={value} index={1}>
				{
					[
					  createData('apple', 159, 6.0, 24, 4.0),
					  createData('beef', 237, 9.0, 37, 4.3),
					  createData('Eclair', 262, 16.0, 24, 6.0),
					  createData('Cupcake', 305, 3.7, 67, 4.3),
					  createData('Gingerbread', 356, 16.0, 49, 3.9),
					]
				}
			</TabPanel>
		</div>
	);
}
